import React, { Component } from "react";


class Button extends Component {
    constructor(props) {
        super(props);
        this.state = {
            title: "Awesome"
        };
      }


    render() {
        return(
            <button href={this.props.link} onClick={() => this.handleClick()}>{this.state.title}</button>
        );
    }

}

export default Button;
